webpackJsonp([0xf927f8900006],{438:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Blog by Michael Lancaster",subtitle:"Software Engineer focused in Javascript applications",copyright:"© All rights reserved.",menu:[{label:"Articles",path:"/"},{label:"About me",path:"/about/"}],author:{name:"Michael Lancaster",twitter:"weblancaster",github:"weblancaster"}}},markdownRemark:{id:"/Users/michaellancaster/Sites/github/michaellancaster-blog/src/pages/about/index.md absPath of file >>> MarkdownRemark",html:'<p>My name is Michael Lancaster. 27. Born in Brasil but moved to US (I have dual citizenship USA and Brazilian) when I was 21 to follow my goals. Now living in San Francisco - CA.</p>\n<p>I’m a Software Engineer focused in Javascript applications (Web, Mobile, Desktop) and often full-stack when including Node (I also get my hands dirty in Python).\nCurrently working as Software Engineer - Frontend at <a href="https://mesosphere.com/">Mesosphere</a></p>\n<p>My spare time I built and maintain side projects <a href="http://www.soundnodeapp.com/">Soundnode</a>, <a href="http://www.solshal.com/">Solshal</a> and I try to contribute to open source projects here and there on <a href="http://www.github.com/weblancaster">Github</a>.</p>\n<p>I have also given a couple talks:</p>\n<ul>\n<li><a href="https://speakerdeck.com/weblancaster/docker-but-im-a-frontend?slide=1">Docker</a> FrontInBH conference (Belo Horizonte - Brazil, 2017)</li>\n<li><a href="https://speakerdeck.com/weblancaster/soundnode-the-journey">Soundnode, the journey</a> HH JS meetup (Hamburg - Germany July, 2017)</li>\n<li><a href="https://speakerdeck.com/weblancaster/intro-to-reactjs">React.js intro</a> Chicago HTML5 meetup (May 12, 2015)</li>\n<li><a href="https://speakerdeck.com/weblancaster/desktop-apps-with-nw-dot-js-and-angular-dot-js-updated">Beyong the web with NW.js</a> FrontInBH (Belo Horizonte - Brazil, 2014) and Chicago Web Conference (Chicago 2015)</li>\n<li><a href="https://speakerdeck.com/weblancaster/css-the-right-way">CSS the right way</a> 2013</li>\n</ul>',frontmatter:{title:"About me",date:"2013-02-27",description:null}}},pathContext:{slug:"/about/"}}}});
